import "./App.css";
import Button from "./Components/Button";

function App() {
  return (
    <div className="App">
      <h1>Todo List</h1>
      <div className="header__date">
        <div>
          <div className="header__date-day">12</div>
          <div className="header__date-month">
            <div>JAN</div>
            <div>2016</div>
          </div>
        </div>
        <div className="header__weekday">Tuesday</div>
      </div>
      <div>List of todos</div>
      <Button />
    </div>
  );
}

export default App;
